import numpy as np
import sys
from gmpy2 import iroot

def egcd(a, b):
    if a == 0:
        return (b, 0, 1)
    else:
        g, x, y = egcd(b % a, a)
        return (g, y - (b // a) * x, x)
        
def modinv(a, m): # modular inverse
    g, x, y = egcd(a, m)
    if g != 1:
        raise Exception('modular inverse does not exist')
    else:
        return x % m

# Chinese Remainder Theorem
def CRT(a, m): 
    M = np.prod(m)
    n = len(a)
    x = 0
    for i in range(n):
        Mi = M // m[i]
        Mi_inv = modinv(Mi % m[i], m[i])
        x += a[i] * Mi * Mi_inv
    return x % M

def dec_to_hex_to_ascii(dec):
    hex_str = hex(dec)[2:]
    print(hex_str)
    if len(hex_str) % 2 != 0:
        hex_str = '0' + hex_str
    return bytes.fromhex(hex_str).decode('utf-8')

